import{_ as a,o as e,c as n,O as k}from"./chunks/framework.43781440.js";const p=JSON.parse('{"title":"FAQ","description":"","frontmatter":{},"headers":[],"relativePath":"id_ID/guide/faq.md","filePath":"id_ID/guide/faq.md"}'),r={name:"id_ID/guide/faq.md"},i=k('<h1 id="faq" tabindex="-1">FAQ <a class="header-anchor" href="#faq" aria-label="Permalink to &quot;FAQ&quot;">â€‹</a></h1><h2 id="apakah-kernelsu-mendukung-perangkat-saya" tabindex="-1">Apakah KernelSU mendukung perangkat saya? <a class="header-anchor" href="#apakah-kernelsu-mendukung-perangkat-saya" aria-label="Permalink to &quot;Apakah KernelSU mendukung perangkat saya?&quot;">â€‹</a></h2><p>Pertama, perangkatmu harus bisa dibuka bootloadernya. Jika tiddak bisa, berarti tidak memungkinkan untuk bekerja.</p><p>Lalu instal aplikasi KernelSU manager di dalam perangkatmu dan buka, jika terlihat <code>Unsupported</code> berarti perangkatmu tidak didukung dan tidak akan didukung di kemudian hari.</p><h2 id="apakah-kernelsu-membutuhkan-buka-bootloader" tabindex="-1">Apakah KernelSU membutuhkan buka-bootloader? <a class="header-anchor" href="#apakah-kernelsu-membutuhkan-buka-bootloader" aria-label="Permalink to &quot;Apakah KernelSU membutuhkan buka-bootloader?&quot;">â€‹</a></h2><p>Ya, seharusnya.</p><h2 id="apakah-kernelsu-mendukung-modul" tabindex="-1">Apakah KernelSU mendukung modul? <a class="header-anchor" href="#apakah-kernelsu-mendukung-modul" aria-label="Permalink to &quot;Apakah KernelSU mendukung modul?&quot;">â€‹</a></h2><p>Ya, Tetapi masih dalam versi awal, bisa jadi ngebug. Mohon tunggu sampai semuanya stabil ðŸ˜ƒ</p><h2 id="apakah-kernelsu-mendukung-xposed" tabindex="-1">Apakah KernelSU mendukung Xposed? <a class="header-anchor" href="#apakah-kernelsu-mendukung-xposed" aria-label="Permalink to &quot;Apakah KernelSU mendukung Xposed?&quot;">â€‹</a></h2><p>Ya, <a href="https://github.com/canyie/Dreamland" target="_blank" rel="noreferrer">Dreamland</a> dan <a href="https://taichi.cool" target="_blank" rel="noreferrer">TaiChi</a> sekarang bekerja sebagian, Dan kita sedang mencoba untuk membuat Xposed Framework lainnya bekerja.</p><h2 id="apakah-kernelsu-kompatibel-dengan-magisk" tabindex="-1">Apakah KernelSU kompatibel dengan Magisk? <a class="header-anchor" href="#apakah-kernelsu-kompatibel-dengan-magisk" aria-label="Permalink to &quot;Apakah KernelSU kompatibel dengan Magisk?&quot;">â€‹</a></h2><p>Sistem modul KernelSU bertentangan dengan magic mount Magisk, jika ada modul yang diaktifkan di KernelSU, maka seluruh Magisk tidak akan bekerja.</p><p>Tetapi jika Anda hanya menggunakan <code>su</code> dari KernelSU, maka KernelSU akan bekerja dengan baik dengan Magisk: KernelSU memodifikasi <code>kernel</code> dan Magisk memodifikasi <code>ramdisk</code>, keduanya dapat bekerja bersama.</p><h2 id="akankah-kernelsu-menggantikan-magisk" tabindex="-1">Akankah KernelSU menggantikan Magisk? <a class="header-anchor" href="#akankah-kernelsu-menggantikan-magisk" aria-label="Permalink to &quot;Akankah KernelSU menggantikan Magisk?&quot;">â€‹</a></h2><p>Kami rasa tidak dan itu bukan tujuan kami. Magisk sudah cukup baik untuk solusi root userspace dan akan bertahan lama. Tujuan KernelSU adalah untuk menyediakan antarmuka kernel kepada pengguna, bukan untuk menggantikan Magisk.</p><h2 id="dapatkah-kernelsu-mendukung-perangkat-non-gki" tabindex="-1">Dapatkah KernelSU mendukung perangkat non GKI? <a class="header-anchor" href="#dapatkah-kernelsu-mendukung-perangkat-non-gki" aria-label="Permalink to &quot;Dapatkah KernelSU mendukung perangkat non GKI?&quot;">â€‹</a></h2><p>Hal ini dimungkinkan. Tetapi Anda harus mengunduh sumber kernel dan mengintegrasikan KernelSU ke source tree dan mengkompilasi kernel sendiri.</p><h2 id="dapatkah-kernelsu-mendukung-perangkat-di-bawah-android-12" tabindex="-1">Dapatkah KernelSU mendukung perangkat di bawah Android 12? <a class="header-anchor" href="#dapatkah-kernelsu-mendukung-perangkat-di-bawah-android-12" aria-label="Permalink to &quot;Dapatkah KernelSU mendukung perangkat di bawah Android 12?&quot;">â€‹</a></h2><p>Kernel perangkatlah yang mempengaruhi kompatibilitas KernelSU dan tidak ada hubungannya dengan versi Android, satu-satunya batasan adalah bahwa perangkat yang diluncurkan dengan Android 12 harus menggunakan kernel 5.10+ (perangkat GKI). Jadi:</p><ol><li>Perangkat yang diluncurkan dengan Android 12 harus didukung.</li><li>Perangkat dengan kernel lama (Beberapa perangkat Android 12 juga memiliki kernel lama) dapat dikompilasi (Anda harus membuat kernel sendiri)</li></ol><h2 id="dapatkah-kernelsu-mendukung-kernel-lama" tabindex="-1">Dapatkah KernelSU mendukung kernel lama? <a class="header-anchor" href="#dapatkah-kernelsu-mendukung-kernel-lama" aria-label="Permalink to &quot;Dapatkah KernelSU mendukung kernel lama?&quot;">â€‹</a></h2><p>Ada kemungkinan, KernelSU sudah di-backport ke kernel 4.14 sekarang, untuk kernel yang lebih lama, Anda harus melakukan backport secara manual dan menyambut baik PR darimu!</p><h2 id="cara-mengintegrasikan-kernelsu-untuk-kernel-lama" tabindex="-1">Cara mengintegrasikan KernelSU untuk kernel lama? <a class="header-anchor" href="#cara-mengintegrasikan-kernelsu-untuk-kernel-lama" aria-label="Permalink to &quot;Cara mengintegrasikan KernelSU untuk kernel lama?&quot;">â€‹</a></h2><p>Silakan merujuk ke <a href="./how-to-integrate-for-non-gki.html">guide</a></p>',24),u=[i];function d(t,l,m,o,s,h){return e(),n("div",null,u)}const b=a(r,[["render",d]]);export{p as __pageData,b as default};
